import { createRoot } from 'react-dom/client'
import React from 'react';
import { useState } from 'react';
import { fetchAllPlayers } from './Create.js'
//import { createCard } from './card.js';

const dummyPuppies = [ {"id": 1, "name": "R2-D2", "breed": "222-222-2222", "team": "r2d2@droids.com"},
{id: 9806, name: 'Lamont', breed: 'Great Dane/Lab', status: 'bench', imageUrl: 'https://animalso.com/wp-content/uploads/2019/02/Great-Dane-Lab-mix-2.jpg'}, 
{id: 9806, name: 'shawn', breed: 'Golden Retriever', status: 'bench', imageUrl: 'https://animalso.com/wp-content/uploads/2019/02/Great-Dane-Lab-mix-2.jpg',} ]


const Main = () => {
    const [puppies, setPuppies] = useState(dummyPuppies);
    return (
     <div id = "main">
        <div id = "navbar">
            <div>Puppy Bowl</div>
        </div>
        <div id = "container">
            {

                puppies.map( (puppy) => {
                    let puppyhtml =`<div id = "pupcard">
                                 <div id = "name">${puppy.name}</div>
                                 <div id = "idnum">${puppy.id}</div>
                                 <img src="${puppy.imageURL}" alt="">
                                 <div id = "breed">${puppy.breed}</div>
                                 <div id = "team">${puppy.teamId}</div>
                             </div>`;
                })
            }
        </div>
     </div>
    )
        }   


const appElement = document.querySelector('#app')
const root = createRoot(appElement)
root.render(<Main />)
